import React, { useState, useEffect } from 'react'
import houselisting from '../assets/mocks/data'
import ListingCard from '../components/ListingCard'
import map from '../assets/images/usa_map_PNG.png'

import axios from 'axios'


export default function listing() {

    let results;
    if (houselisting.length > 0) {
      results = houselisting.map((house, index) => 
      <ListingCard key={house.sys.id} {...house} />);
    } else {
      results = (
        <div>
          <h2>Sorry!</h2>
          <h3> No listings available yet.</h3>
        </div>
      );
    }

    return (
        <section className="container listings">
            <div className="map-contianer">
                <img src={map} alt="map"></img> 
            </div>
            <div className="listings-container">
                {results}
            </div>

        </section>


    )
}
